// src/pages/Dashboard.js
import { useState, useEffect, useCallback } from "react";
import Sidebar from "../components/sidebar";
import Topbar from "../components/Topbar";

function Dashboard({ username, setUsername }) {
  const [tasks, setTasks] = useState([]);
  const [taskTitle, setTaskTitle] = useState("");

  // Load tasks from backend
  const loadTasks = useCallback(async () => {
    try {
      const res = await fetch(`http://localhost:5000/tasks/${username}`);
      const data = await res.json();
      setTasks(data);
    } catch (err) {
      console.error("Error loading tasks:", err);
    }
  }, [username]);

  useEffect(() => {
    if (username) loadTasks();
  }, [username, loadTasks]);

  // Add new task
  const addTask = async () => {
    if (!taskTitle.trim()) return;

    const newTask = {
      title: taskTitle,
      status: "Pending",
      priority: "Medium",
      created: new Date().toISOString().slice(0, 10),
    };

    await fetch(`http://localhost:5000/tasks/${username}`, {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(newTask),
    });

    setTaskTitle("");
    loadTasks();
  };

  // Delete task
  const deleteTask = async (id) => {
    await fetch(`http://localhost:5000/tasks/${username}/${id}`, {
      method: "DELETE",
    });
    loadTasks();
  };

  // Edit task status or title
  const editTask = async (id, updatedTask) => {
    await fetch(`http://localhost:5000/tasks/${username}/${id}`, {
      method: "PUT",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(updatedTask),
    });
    loadTasks();
  };

  // Logout
  const logout = () => {
    localStorage.removeItem("username");
    setUsername(null);
  };

  return (
    <div className="dashboard-container">
      <Sidebar />

      <div className="dashboard-main">
        <Topbar username={username} logout={logout} />

        <div className="task-section">
          <h2>Welcome, {username}</h2>

          <div className="add-task">
            <input
              type="text"
              placeholder="Add a new task..."
              value={taskTitle}
              onChange={(e) => setTaskTitle(e.target.value)}
            />
            <button onClick={addTask}>Add Task</button>
          </div>

          <h3>Your Tasks</h3>
          {tasks.length === 0 && <p>No tasks yet. Add your first task!</p>}

          <table className="task-table">
            <thead>
              <tr>
                <th>Title</th>
                <th>Status</th>
                <th>Priority</th>
                <th>Created</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {tasks.map((t) => (
                <tr key={t.id}>
                  <td>{t.title}</td>
                  <td>{t.status}</td>
                  <td>{t.priority}</td>
                  <td>{t.created}</td>
                  <td>
                    <button
                      onClick={() =>
                        editTask(t.id, { ...t, status: t.status === "Pending" ? "Completed" : "Pending" })
                      }
                    >
                      Toggle Status
                    </button>
                    <button onClick={() => deleteTask(t.id)}>Delete</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
